(function main() {
    var xhrHomeCountry = new XMLHttpRequest(),
        xhrAwayCountry = new XMLHttpRequest(),
        gameTime = "";

    var SETTINGS = {
        DEFAULT_FILL: 'green',
        FROM_COLOR: '#000000',
        TO_COLOR: '#cccccc',
        ANIMATION_TIME: 2000,
        ANIMATION_INTERVAL: 100,
        FOLLOWING_INTERVAL: 1000,
        API_URL: "http://127.0.0.1:8080/game",
        GAME_TIME: new Date(2014, 6, 1, 1, 30, 20)  
    };

    var start = function () {
        this.map = new Datamap({
            element: document.getElementById('map'),
            fills: {
                defaultFill: SETTINGS.DEFAULT_FILL
            }
        });
        this.map.labels(); // Fill country names
        gameTime = SETTINGS.GAME_TIME;
        follow("brasil", "germany");
    };

    var follow = function (homeCountry, awayCountry) {
        setInterval(function () {
            var now = {},
                startTime = {},
                endTime = {};

            now = getTime(new Date());
            showClock(now);

            // gameTime.setSeconds(gameTime.getSeconds() + 350);
            startTime = getTime(gameTime);
            startTime = startTime.year + startTime.month + startTime.day + startTime.hours + startTime.minutes + startTime.seconds;
            gameTime.setSeconds(gameTime.getSeconds() + 350100);
            endTime = getTime(gameTime);
            endTime = endTime.year + endTime.month + endTime.day + endTime.hours + endTime.minutes + endTime.seconds;

            

            xhrGet(xhrHomeCountry, SETTINGS.API_URL + '/' + homeCountry + '?start=' + startTime + '&finish=' + endTime, checkResponse);
            for(i=0; i< 1500000; i++){
            	x = i;
            }
            xhrGet(xhrAwayCountry, SETTINGS.API_URL + '/' + awayCountry + '?start=' + startTime + '&finish=' + endTime, checkResponse);
        }, SETTINGS.FOLLOWING_INTERVAL)
    }

    var xhrGet = function (xhr, url, cb) {
        xhr.onreadystatechange = function () {
            cb();
        };
        xhr.open('GET', url);
        xhr.send();
    }

    var checkResponse = function () {
        var responseHomeCountry = {},
            responseAwayCountry = {};

        try {
            if (xhrHomeCountry.readyState === 4) {
                if (xhrHomeCountry.status === 200) {
                    responseHomeCountry = JSON.parse(xhrHomeCountry.responseText);
                    if (responseHomeCountry.length > 0) {
                        highlight(getCode(responseHomeCountry[0].country), "green", "yellow");
                        console.log("Highlight", responseHomeCountry[0].country);
                    }
                }
            }

            if (xhrAwayCountry.readyState === 4) {
                if (xhrAwayCountry.status === 200) {
                    responseAwayCountry = JSON.parse(xhrAwayCountry.responseText);
                    if (responseAwayCountry.length > 0) {
                        highlight(getCode(responseAwayCountry[0].country), "red", "black");
                        console.log("Highlight", responseAwayCountry[0].country);
                    }
                }
            }
        }
        catch (ex) {
            console.log("Error", xhrHomeCountry, xhrAwayCountry)
        }
    }

    var highlight = function (country, fromColor, toColor) {
        var _this = this,
            choropleth = {},
            from = {},
            to = {},
            original = {};

        from[country] = fromColor;
        to[country] = toColor;
        original[country] = SETTINGS.DEFAULT_FILL;

        console.log("animation", animation);
        var animation = setInterval(function () {
            choropleth = (choropleth === from) ? to : from;
            _this.map.updateChoropleth(choropleth);
        }, SETTINGS.ANIMATION_INTERVAL);
        setTimeout(function () {
            console.log("animation", animation);
            clearInterval(animation);
            _this.map.updateChoropleth(original); // Roll back to default color
        }, SETTINGS.ANIMATION_TIME)
    }

    var showClock = function (now) {
        document.getElementById("clock").innerText = now.hours + ":" + now.minutes + ":" + now.seconds;
    }

    var getTime = function (date) {
        return {
            year: checkZero(date.getFullYear().toString()),
            month: checkZero(date.getMonth().toString()),
            day: checkZero(date.getUTCDate().toString()),
            hours: checkZero(date.getHours().toString()),
            minutes: checkZero(date.getMinutes().toString()),
            seconds: checkZero(date.getSeconds().toString())
        }
    }

    var checkZero = function (i) {
        if (i.length === 1) {
            i = "0" + i;
        }
        return i;
    }

    var getCode = function (country) {
        if (country === "brasil") {
            return "BRA";
        }
        else if (country === "germany") {
            return "DEU";
        }
    }

    start();

})();